export const CreateReducer = (state = {counter: 0}, action) => {
    if(action.type === "increment") {
        return {count: state.counter + 1}
    }
    if(action.type === "decrement") {
        return {count: state.counter - 1}
    }
    if(action.type === "reset") {
        return {count: 0}
    }
    return state
}
